import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header className='header'>
        <img src="http://portal.euroset.lan/euroset.ru~customize~portal~afp/img/logo2.png" />
      </header>
      <nav>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
      </nav>
      <div>
        Main content
      </div>
    </div>
  );
}

export default App;
